import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from 'react';

function App() {

  const [profile, setProfile] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:3003/api/profile');
        const data = await response.json();
        setProfile(data);
      } catch (error) {
        console.error('Error al obtener datos:', error);
      }
    };
    fetchData();
    console.log(profile);
  }, []);


  return (
    <div>
      <h1>Nombre: </h1>
      {profile.map((prof) => (
        <div key={prof.name} className="mb-4">
          <h3>{prof.name}</h3>
          <table className="table">
            <thead>
              <tr>
                <th>ID</th>
                <th>Intereses</th>
              </tr>
            </thead>
            <tbody>
              {prof.intereses.map((interes, index) => (
                <tr key={index}>
                  <td>{index + 1}</td>
                  <td>{interes}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}

    </div>

  );
}

export default App;
